import React, { useEffect, useState } from 'react';
import { useAnimeState } from '../ducks/anime/selectors';

const Detail = (): JSX.Element => {
	const animeList = useAnimeState().anime.items.animeList;

	const [title, setTitle] = useState('aaa');

	const createAnimeList = () => {
		console.log(animeList);
		Object.keys(animeList).map((animeInfo) => {
			console.log(animeList[animeInfo]);
		});
	};

	useEffect(() => {
		Object.keys(animeList).map((animeInfo) => {
			setTitle({
				title: animeList[animeInfo].title,
			});
		});
	});

	return (
		<>
			<button onClick={createAnimeList}>test</button>
		</>
	);
};

export default Detail;
